void MAST::Solid1DHat1SectionElementPropertyCard::init() {
    
    libmesh_assert(!_initialized);
    
    MAST::FieldFunction<Real>
    &DIM1     =  this->get<MAST::FieldFunction<Real> >("DIM1"),
    &DIM2     =  this->get<MAST::FieldFunction<Real> >("DIM2"),
    &DIM3     =  this->get<MAST::FieldFunction<Real> >("DIM3"),
    &DIM4     =  this->get<MAST::FieldFunction<Real> >("DIM4"),
    &DIM5     =  this->get<MAST::FieldFunction<Real> >("DIM5"),
    &hy_off =  this->get<MAST::FieldFunction<Real> >("hy_off"),
    &hz_off =  this->get<MAST::FieldFunction<Real> >("hz_off");
    
    // Check that dimensions are physically correct
    Real DIM1v, DIM2v, DIM3v, DIM4v, DIM5v;
    DIM1(DIM1v); DIM2(DIM2v); DIM3(DIM3v); DIM4(DIM4v); DIM5(DIM5v);
    if (DIM1v<=0){
        libmesh_error_msg("DIM1<=0");
    }
    else if (DIM2v<=0){
        libmesh_error_msg("DIM2<=0");
    }
    else if (DIM3v<=0){
        libmesh_error_msg("DIM3<=0");
    }
    else if (DIM4v<=0){
        libmesh_error_msg("DIM4<=0");
    }
    else if (DIM5v<=0){
        libmesh_error_msg("DIM5<=0");
    }
    else if ((DIM5v+2.0*DIM4v)>=DIM2v){
        libmesh_error_msg("(DIM5+2*DIM4)>=DIM2");
    }
    
    
    _A.reset(new MAST::Solid1D5ParameterSectionProperty::Area(MAST::Solid1DHat1SectionProperty::calcA,
                                                              MAST::Solid1DHat1SectionProperty::calcdA,
                                                              DIM1, DIM2, DIM3, 
                                                              DIM4, DIM5));
    
    _Ay.reset(new MAST::Solid1D5ParameterSectionProperty::AreaYMoment(
                                                                MAST::Solid1DHat1SectionProperty::calcA,
                                                                MAST::Solid1DHat1SectionProperty::calcdA,
                                                                DIM1, DIM2, 
                                                                DIM3, DIM4, 
                                                                DIM5,
                                                                hz_off));
    
    _Az.reset(new MAST::Solid1D5ParameterSectionProperty::AreaZMoment(
                                                                MAST::Solid1DHat1SectionProperty::calcA,
                                                                MAST::Solid1DHat1SectionProperty::calcdA,
                                                                DIM1, DIM2, 
                                                                DIM3, DIM4,
                                                                DIM5,
                                                                hy_off));
    
    _J.reset(new MAST::Solid1D5ParameterSectionProperty::TorsionalConstant(
                                                                MAST::Solid1DHat1SectionProperty::calcJ,
                                                                MAST::Solid1DHat1SectionProperty::calcdJ,
                                                                DIM1, DIM2,
                                                                DIM3, DIM4,
                                                                DIM5));
    
    _Ip.reset(new MAST::Solid1D5ParameterSectionProperty::PolarInertia(
                                                                MAST::Solid1DHat1SectionProperty::calcIp,
                                                                MAST::Solid1DHat1SectionProperty::calcdIp,
                                                                MAST::Solid1DHat1SectionProperty::calcA,
                                                                MAST::Solid1DHat1SectionProperty::calcdA,
                                                                DIM1, DIM2,
                                                                DIM3, DIM4,
                                                                DIM5,
                                                                hy_off,
                                                                hz_off));
    
    _AI.reset(new MAST::Solid1D5ParameterSectionProperty::AreaInertiaMatrix(
                                                                MAST::Solid1DHat1SectionProperty::calcIz,
                                                                MAST::Solid1DHat1SectionProperty::calcdIz,
                                                                MAST::Solid1DHat1SectionProperty::calcIy,
                                                                MAST::Solid1DHat1SectionProperty::calcdIy,
                                                                MAST::Solid1DHat1SectionProperty::calcA,
                                                                MAST::Solid1DHat1SectionProperty::calcdA,
                                                                DIM1, DIM2,
                                                                DIM3, DIM4,
                                                                DIM5,
                                                                hy_off,
                                                                hz_off));
    
    _initialized = true;
}
